import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import TaskIcon from '@mui/icons-material/Task';
import { useNavigate } from 'react-router-dom';
import React, { useState } from "react";
import axios from "axios";
import { API_URL } from "../utils";
export const HomepageForm = ( { fetchUser }) => {
  // const [user, setUser] = useState({
  //   firstName: '',
  //   lastName: '',
  //   email: '',
  //   OrgID: '',
  //   UserID: '',
  //   valid: false
  // });
  const [newUser, setNewUser] = useState("");
  const [newFirst, setNewFirst] = useState("");
  const [newLast, setNewLast] = useState("");
  const [newEmail, setNewEmail] = useState("");
  const addNewUser = async () => {
    try {
      await axios.get(API_URL, {
        OrgID: newUser,
        firstName: newFirst,
        lastName: newLast,
        email: newEmail
      });
      //await fetchUser();
      setNewUser("");
      setNewFirst("");
      setNewLast("");
      setNewEmail("");
      console.log('user has been atemmppteed')
      navigate('/homepage'); // redirect to new page
    } catch (err) {
      console.log(`you failed to retrieve information ${err}`);
    }
  };
  // const handleInputChange = (e) => {
  //   const { name, value } = e.target;
  //   setUser((prevUser) => ({ ...prevUser, [name]: value }));
  // };
  const navigate = useNavigate();
  return (
    <loginBody>
    <div className='rectangle'>
    <div class="logo-container">
    <img src="thatpivc.png" alt="WebWiz Logo" class="logo"/>
    <span class="logo-text">WEBWIZ</span>
    </div>
      <Typography align="left" variant="h6" paddingTop={2} paddingBottom={2}>
        Create your WebWizâ„¢ account
      </Typography>
      <div className='addUserForm'>
      <TextField fullWidth size='small'
      id="outlined-basic"
      label="First Name"
      name='firstName'
      variant="outlined"
      value={newFirst}
      onChange={(e) => setNewFirst(e.target.value)} />
<TextField fullWidth size='small'
      id="outlined-basic"
      label="Last Name"
      name='lastName'
      variant="outlined"
      value={newLast}
      onChange={(e) => setNewLast(e.target.value)} />
</div>
<div className='addUserForm'>
<TextField fullWidth size='small'
      id="email"
      label="Email"
      variant="outlined"
      value={newEmail}
      onChange={(e) => setNewEmail(e.target.value)}
      name='email'/>
</div>
<div className='addUserForm'>
<TextField fullWidth size='small'
      id="outlined-basic"
      label="Organization ID"
      variant="outlined"
      value={newUser}
      onChange={(e) => setNewUser(e.target.value)}
      name='OrgID'/>
      <Button size='big' disabled={!newUser.length || !newFirst.length || !newLast.length || !newEmail.length}
      variant='outlined' onClick={addNewUser} paddingTop={2}>
       <TaskIcon/>save
      </Button>
      </div>
      <div className='tinytext'>
      By creating an account, you accept all of the WebWiz terms and conditions
      </div>
    </div>
    </loginBody>
  )
}
